import React, {Component} from 'react';
import {Helmet} from "react-helmet";

const title = "Skills|Alper Tunca";

class Skills extends Component {
    render() {
        return (
            <div>
                <Helmet>
                    <title>{title}</title>
                </Helmet>



            </div>
        );
    }
}

export default Skills;
